 Continued from Runaway *** I couldn't believe it when she called and asked if she could come home. I hadn't heard from my daughter in months... Lily was back at my door the next day. I knew something was different about her, but I tried to ignore those thoughts. I was just so happy. Alex and his Mother were long gone. I expected to be alone until I sold the house, but Lily was back, and I knew anything was possible again... Lily was always my favorite, she grew up to be so beautiful, and with so much promise. And maybe that's gone now, I'm not sure of anything anymore... It wasn't long before I found out why she really left. I could have never guessed the real reason why my family had fallen apart, and the things I would do with her... And now I don't care. What matters is that I have my daughter again, and she's all the family I'll ever need.... ***Starring Lily Rader***
